import React from 'react'
import { Link } from 'react-router-dom'
import '../styles/Sidenav.css';
const Sidenav = (props) => {
  return (
    <nav>
      <h1 className="nav-logo"><span className="fa-brands fa-spotify"></span> Song Palate</h1>
      <ul className="links-container">
        <li className="link-list"><Link to="/">hi</Link></li>
      </ul>
    </nav>
  )
}

export default Sidenav
